import React, {useState, useEffect} from "react";
import {getTypes, postPokemons} from '../actions/index';
import { Link, useHistory } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";

function validate(input){
    let errors={};
    if(!input.name){
        errors.name="Se requiere un nombre"
    } else if (!input.image){
        errors.image="La imagen debe ser un link";
    }
    return errors;
}
export default function CreateVideogame(){
    const dispatch=useDispatch()
    const history=useHistory()
    const genres=useSelector((state)=>state.genres)
    const [errors, setErrors]=useState({})
    const [input, setInput]=useState({
        name:"", 
        description:"",
        platforms:"", 
        background_image:"",
        released:"",
        rating:"",  
        genre:[]
    })
    const handleChange=(e)=>{
        setInput({
            ...input,
            [e.target.name]:e.target.value
        })
        setErrors(validate({
            ...input,
            [e.target.name]:e.target.value
        }))
    };
    const handleSelect=(e)=>{
        if(e.target.checked){
            setInput({
                ...input, 
                types:[...input.types, 
                    e.target.value]
        })
        }
    }
    const handleSubmit=(e)=>{
        e.preventDefault()
        dispatch(postPokemons(input))
        alert("Pokemon created")
        setInput({
        name:"", 
        image:"",
        life:"", 
        attack:"",
        defense:"",
        speed:"", 
        height:"", 
        weight:"", 
        type:[]
        })
        history.push("/home")
    }
    useEffect(()=>{
        dispatch(getTypes())
    },[]);
    return (
        <div>
            <Link to='/home'><button>Back to home</button></Link>
            <h1>Create your pokemon</h1>
            <form onSubmit={(e)=>handleSubmit(e)}>
                <div>
                <label>Name</label>
                <input type='text' value={input.name} name='name' onChange={(e)=>handleChange(e)}></input>
                {errors.name &&(
                    <p className="error">{errors.name}</p>
                )}
                </div>
                <div>
                <label>Image</label>
                <input type='text' value={input.image} name='image' onChange={(e)=>handleChange(e)}></input>
                {errors.image &&(
                    <p className="error">{errors.image}</p>
                )}
                </div>
                <div>
                <label>Life</label>
                <input type='text' value={input.life} name='life' onChange={(e)=>handleChange(e)}></input>
                </div>
                <div>
                <label>Attack</label>
                <input type='text' value={input.attack} name='attack' onChange={(e)=>handleChange(e)}></input>
                </div>
                <div>
                <label>Defense</label>
                <input type='text' value={input.defense} name='defense' onChange={(e)=>handleChange(e)}></input>
                </div>
                <div>
                <label>Speed</label>
                <input type='text' value={input.speed} name='speed' onChange={(e)=>handleChange(e)}></input>
                </div>
                <div>
                <label>Height</label>
                <input type='text' value={input.height} name='height' onChange={(e)=>handleChange(e)}></input>
                </div>
                <div>
                <label>Weight</label>
                <input type='text' value={input.weight} name='weight' onChange={(e)=>handleChange(e)}></input>
                </div>
                <div>
                <select onChange={(e)=>handleSelect(e)}> 
                {types.map((elem)=> {return <option value={elem.name}>{elem.name}</option>})}
                </select>
                <ul><li>{input.type.map(elem=>elem + " ,")}</li></ul>
                </div>
                <button type="submit">Create pokemon</button>
            </form>
        </div>
    )
}
